// Variables
// ==================
$font: "Lato", sans-serif;
$font-alt: "Amiri", serif;

// Font face
// ==================

@import url("https://fonts.googleapis.com/css?family=Amiri|Lato:300,900&display=swap");

// Texts styles
// ==================
.text-sm {
    font-size: 0.875rem;
}

.text-big {
    font-size: 2.25rem;
    font-family: $font-alt;
}

@include up(768) {
    .text-sm {
        font-size: 1rem;
    }
}

@include up(992) {
    .text-big {
        font-size: 3.5rem;
    }
}

sources.scss/style.scss:
// Variables
// ==================
:root {
    --black: #0e0d0b;
    --white: #f1f2f4;
}

// Outils
// ==================
@import "tools/reset";
@import "tools/mixins";
@import "tools/typography";

// Generic
// ==================

html,
body {
    width: 100%;
    height: auto;
    min-height: 100vh;
    min-height: calc(var(--vh, 1vh) * 100);
}

body {
    font-family: $font;
    font-size: 16px;
    color: var(--white);
    line-height: 1.5;
    background-color: var(--black);
    position: relative;
    overflow-x: hidden;
}

.container {
    padding-left: 40px;
    padding-right: 40px;
}

.top__link__left {
    position: absolute;
    z-index: 10;
    padding: 20px;
    top: 20px;
    left: 20px;
}


.top__link {
    position: absolute;
    z-index: 10;
    padding: 20px;
    top: 20px;
    right: 20px;
}

.top__link.link__home {
    left: 30px;
    bottom: 20px;
    top: auto;
    z-index: 3;
    mix-blend-mode: normal;
}

@include up(768) {
    .container {
        padding-left: 50px;
        padding-right: 50px;
    }

    .top__link {
        top: 30px;
        right: 30px;
        position: fixed;
        mix-blend-mode: difference;
    }
}

@include up(992) {
    .container {
        padding-left: 162px;
        padding-right: 162px;
    }

    .link {
        position: relative;
    }

    .link::after {
        content: "";
        position: absolute;
        width: 0;
        height: 1px;
        display: block;
        right: 0;
        background: #fff;
        transition: width 0.2s ease;
    }

    .link:hover::after {
        width: 100%;
        left: 0;
        background: #fff;
    }
}

// Modules
// ==================
@import "modules/footer";
@import "modules/transition";

// Pages
// ==================
@import "pages/home";
@import "pages/project";
@import "pages/about";

#particles-js {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: -1;
}

sources.scss/tools/_reset.scss:
// http://meyerweb.com/eric/tools/css/reset/
//  v2.0 | 20110126
//  License: none (public domain)
*,
*::before,
*::after {
    box-sizing: border-box;
}
html,
body,
div,
span,
applet,
object,
iframe,
h1,
h2,
h3,
h4,
h5,
h6,
p,
blockquote,
pre,
a,
abbr,
acronym,
address,
big,
cite,
code,
del,
dfn,
em,
img,
ins,
kbd,
q,
s,
samp,
small,
strike,
strong,
sub,
sup,
tt,
var,
b,
u,
i,
center,
dl,
dt,
dd,
ol,
ul,
li,
fieldset,
form,
label,
legend,
table,
caption,
tbody,
tfoot,
thead,
tr,
th,
td,
article,
aside,
canvas,
details,
embed,
figure,
figcaption,
footer,
header,
hgroup,
menu,
nav,
output,
ruby,
section,
summary,
time,
mark,
audio,
video {
    margin: 0;
    padding: 0;
    border: 0;
    font-size: 100%;
    font: inherit;
    vertical-align: baseline;
}
button {
    padding: 0;
    border: none;
    cursor: pointer;
    background: transparent;
    font-size: inherit;
}
select,
input {
    font-size: inherit;
    font-family: inherit;
}
pre {
    font-family: monospace;
}
// HTML5 display-role reset for older browsers
article,
aside,
details,
figcaption,
figure,
footer,
header,
hgroup,
menu,
nav,
section {
    display: block;
}
body {
    line-height: 1;
}
ol,
ul {
    list-style: none;
}
blockquote,
q {
    quotes: none;
}
blockquote:before,
blockquote:after,
q:before,
q:after {
    content: "";
    content: none;
}
table {
    border-collapse: collapse;
    border-spacing: 0;
}
img {
    max-width: 100%;
}
a {
    text-decoration: none;
    color: inherit;
}
textarea {
    font-size: inherit;
    font-family: inherit;
    line-height: inherit;
}
hr {
    height: 1px;
    background: var(--border);
    margin: 0;
    padding: 0;
    border: none;
}

